import React from 'react'
import "../estilos/Logo.css"
import imgLogo from  '../img/Logosyrecursos/LOGO-VIFRA_d400.png'
function Logo(){
    return(
        <div className = "Logo">
            <div className = "Logo-Tamanio">
                <img src={imgLogo} className = "Logo-Tamanio"></img>
            </div>
        </div>
    )
        
    
}

export default Logo
